#blessed #love #grateful #trusttheprocess🙏

Carver turned 3 yesterday but because of my surgery and my sister moving we had his party a couple weeks ago. I can’t believe how big he has gotten!!! He is a monster truck loving, wrestling, compassionate, beautiful, smart, momma’s boy!! He makes momma coffee every morning. Kisses his sister good night. And takes out his daddy’s knees! Carver was/is exactly what we as a family need. I remember in those first few weeks of the pandemic saying God knew what we needed and that was/is Carver.

Huge Thank You to @perfectmomentseventshoppe for the perfect cake and doughnuts!!! 

